import "./ExpenselItem.css";
import Expendelitem from "./Expenselitem.js";
import "./Expense.css";
import Cards from "../UI/Cards.js";
import React from "react";
const Expense = (props) => {
  return(
   <Cards className='expense'>
     {/* [{data,id,amount,title}] */}
        props.data.forEach((ele) => {
                <Expendelitem  
                   data={ele.data}
                   title={ele.title}  
                   amount={ele.amount}/>
 
     });
      <Expendelitem data={props.data[0].data} 
        title={props.data[0].title}
        amount={props.data[0].amount} />
      <Expendelitem data={props.data[1].data} 
        title={props.data[1].title}
        amount={props.data[1].amount}
      ></Expendelitem>
      <Expendelitem data={props.data[2].data} 
        title={props.data[2].title}
        amount={props.data[2].amount}
      ></Expendelitem>
      <Expendelitem data={props.data[3].data} 
        title={props.data[3].title}
        amount={props.data[3].amount}/>
   </Cards> )
}
export default Expense;
